        players: ['Damian Lillard', 'CJ McCollum', 'Nassir Little'],
    },
    {
        name: 'Sacramento Kings',
        players: ["De'Aaron Fox", 'Domantas Sabonis', 'Harrison Barnes'],
    },
    {
        name: 'San Antonio Spurs',
        players: ['Dejounte Murray', 'Keldon Johnson', 'Jakob Poeltl'],
    },
    {
        name: 'Toronto Raptors',
        players: ['Pascal Siakam', 'Fred VanVleet', 'Scottie Barnes'],
    },
    {
        name: 'Utah Jazz',
        players: ['Donovan Mitchell', 'Rudy Gobert', 'Mike Conley'],
    },
    {
        name: 'Washington Wizards',
        players: ['Bradley Beal', 'Kristaps Porziņģis', 'Kyle Kuzma'],
    },
];

export function SelectTeam({ onSelectTeam, onSelectPlayers }) {
    const [selectedTeam, setSelectedTeam] = useState('');
    const [selectedPlayers, setSelectedPlayers] = useState([]);

    const handleTeamChange = (e) => {
        setSelectedTeam(e.target.value);
        setSelectedPlayers([]);
        if (onSelectTeam) onSelectTeam(e.target.value);
    };

    const handlePlayerToggle = (player) => {
        let updated;
        if (selectedPlayers.includes(player)) {
            updated = selectedPlayers.filter(p => p !== player);
        } else if (selectedPlayers.length < 5) {
            updated = [...selectedPlayers, player];
        } else {
            updated = selectedPlayers;
        }
        setSelectedPlayers(updated);
        if (onSelectPlayers) onSelectPlayers(updated);
    };

    const currentTeam = teamsData.find((team) => team.name === selectedTeam);

    return (
        <div>
            <label htmlFor="team-select">Select NBA Team:</label>
            <select
                id="team-select"
                value={selectedTeam}
                onChange={handleTeamChange}
            >
                <option value="">--Choose a team--</option>
                {teamsData.map((team) => (
                    <option key={team.name} value={team.name}>
                        {team.name}
                    </option>
                ))}
            </select>

            {currentTeam && (
                <div style={{ marginTop: 16 }}>
                    <div>Select up to 5 Players:</div>
                    {currentTeam.players.map((player) => (
                        <div key={player}>
                            <label>
                                <input
                                    type="checkbox"
                                    checked={selectedPlayers.includes(player)}
                                    onChange={() => handlePlayerToggle(player)}
                                    disabled={
                                        !selectedPlayers.includes(player) &&
                                        selectedPlayers.length >= 5
                                    }
                                />
                                {player}
                            </label>
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
}

export default SelectTeam;
